	@Override
	protected void exportConfig(final Index index, final SolrClient solrClient)
			throws SolrServiceException, SolrServerException, IOException
	{
		final Map<String, ManagedResource> managedResources = this.loadManagedResourcesFromServer(index, solrClient);
		final List<String> languages = this.collectLanguages(index.getFacetSearchConfig());

		this.updateSynonyms(index, solrClient, managedResources, languages);
		this.updateStopWords(index, solrClient, managedResources, languages);
		this.updateDecompounds(index, solrClient, managedResources, languages);
	}


	// make the Methods from the AbstractSolrSearchProvider visible to the WagoSolrDecompoundProvider
	@Override
	public String encode(final String string) throws SolrServiceException
	{
		if (string.matches(".*[$&+,/:;=?@<>%{}|\\\\^~\\[\\]`#].*"))
		{
			// if the string contains one of this special characters we need to encode twice to delete correctly
			return super.encode(super.encode(string));
		}

		return super.encode(string);
	}

