private IndexedType getIndexedType(final FacetSearchConfig facetSearchConfig)
{
	if (facetSearchConfig == null)
	{
		throw new IllegalArgumentException("No FacetSearchConfig found for " + FACET_SEARCH_CONFIG);
	}
	if (facetSearchConfig.getIndexConfig() == null || facetSearchConfig.getIndexConfig().getIndexedTypes() == null)
	{
		throw new IllegalArgumentException("No Index Config or IndexedTypes found for " + FACET_SEARCH_CONFIG);
	}
	final Optional<IndexedType> firstIndexedType = facetSearchConfig.getIndexConfig().getIndexedTypes().values().stream()
			.findFirst();
	if (!firstIndexedType.isPresent())
	{
		throw new IllegalArgumentException("No IndexedTypes found for " + FACET_SEARCH_CONFIG);
	}
	return firstIndexedType.get();
}

