	private boolean isSearchHighlightActive()
	{
		return isSessionAttribute(WagoCoreConstants.SESSION_HIGHLIGHT_SEARCH);
	}

	private boolean isSessionAttribute(final String paramName)
	{
		final Object sessionParam = this.sessionService.getAttribute(paramName);
		boolean propDebug = false;
		if (sessionParam instanceof Boolean)
		{
			propDebug = ((Boolean) sessionParam).booleanValue();
		}
		return propDebug;
	}

	/**
	 * @param sessionService
	 */
	@Autowired
	public void setSessionService(final SessionService sessionService)
	{
		this.sessionService = sessionService;
	}

